    @Override
    public EmailSet convertToEntityAtrribute(String dbData) {
        if (dbData == null) return null;
        String[] emails = dbData.split(",");
        Set emailSet = Arrays.stream(emails)
                .map(value -> new Email(value))
                .collec(toSet());
        return new EmailSet(emailSet);
    }
}


